import React from "react";

class Header extends React.Component {
    render () {
        return (
            <div class="w3-top">
            <div class="w3-bar w3-theme1" id="myNavbar">
              <a class="w3-bar-item w3-button w3-hover-white w3-hide-medium w3-hide-large w3-right" href="javascript:void(0);" onclick="toggleFunction()" title="Toggle Navigation Menu">
                <i class="fa fa-bars"></i>
              </a>
              <a href="impressum.html" class="w3-bar-item w3-button w3-text-white w3-hide-small"><i class="fa fa-book"></i> Legal notice</a>
            </div>
        
            <div id="navDemo" class="w3-bar-block w3-theme1 w3-hide w3-hide-large w3-hide-medium">
              <a href="impressum.html" class="w3-bar-item w3-button" onclick="toggleFunction()">Legal notice</a>
            </div>
          </div>
        );
    }
}

export default Header;
